  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the findings of
  a study on Karluk Lake sockeye salmon. The objectives of the study were to: collect
  sediment core samples from Karluk Lake and other nearby sockeye salmon lakes; determine
  the incidence of predation by char and coho salmon on juvenile sockeye salmon; and
  determine the spatial and temporal distribution, and relative abundance of fish
  species in Karluk Lake to identify where potential areas of competition can occur.
  A discussion of the results is included.\",\n\t\"license_title\": \"License Not
